class ShowArtifactInfoDialogComponent {
    constructor(data, artifactService, userService, dialogRef, snackBar, utilService) {
        this.data = data;
        this.artifactService = artifactService;
        this.userService = userService;
        this.dialogRef = dialogRef;
        this.snackBar = snackBar;
        this.utilService = utilService;
        this.isEditable = false;
    }
    ngOnInit() {
        this.userService.getUserInfo()
            .subscribe((user) => {
            this.user = user;
        });
        this.artifactService.getArtifactFromID(this.data.artID, this.data.workspaceReference)
            .subscribe((artifact) => {
            this.artifact = artifact;
        });
        this.artifactService.getArtifactSize(this.data.artID)
            .subscribe((data) => {
            const { sum } = data;
            const size = parseInt(sum);
            this.artifactSize = this.utilService.assessFileSize(size);
        });
    }
    makeFieldsEditable() {
        this.isEditable = true;
    }
    canceEdit() {
        this.isEditable = false;
    }
    saveChanges() {
        // TODO : Fix this issue of subscribe not triggering
        this.artifactService.changeNameAndDescription(this.artifact.name, this.artifact.description, this.data.artID)
            .subscribe((response) => {
            if (response.status === 200) {
                this.isEditable = false;
                const ref = this.snackBar.open("Changes Made Successfully", "Okay");
                ref.onAction()
                    .subscribe(() => {
                    this.dialogRef.close();
                });
            }
        }, (err) => {
            console.log(err);
        });
    }
}
